import React from "react";

export default function Card({
  selectDrink,
  idDrink,
  strDrink,
  strAlcoholic,
  strDrinkThumb,
  strIBA,
}) {
  return (
    <div className="col s12 m6 l3" key={strDrink}>
      <div className="container">
        <img
          src={strDrinkThumb}
          className="circle responsive-img"
          width="400"
        />
        <h4>{strDrink}</h4>

        <p>{strIBA}</p>

        <p>{strAlcoholic}</p>

        <a
          className="waves-effect waves-light btn"
          onClick={(e) => selectDrink(idDrink)}
        >
          View Detail
        </a>
      </div>
      <style global jsx>{`
        .hero {
          background: url("/images/hero.jpg") no-repeat 0% 0%;
          background-size: cover;
          min-height: 100vh;
        }
        .search {
          position: absolute;
          width: 40rem;
          top: 40%;
          left: 50%;
        }
      `}</style>
    </div>
  );
}
